import React, { useState } from 'react';
import Link from 'next/link'; 

const instaPhotos = [
  '/insta-photos/1-action.jpeg',
  '/insta-photos/2-action.jpeg',
  '/insta-photos/3-action.jpeg',
  '/insta-photos/4-action.jpeg',
  '/insta-photos/5-action.jpeg',
  '/insta-photos/6-action.jpeg',
  '/insta-photos/7-action.jpeg',
  '/insta-photos/8-action.jpeg',
  '/insta-photos/9-action.jpeg',
  '/insta-photos/10-action.jpeg',
  '/insta-photos/11-action.jpeg',
  '/insta-photos/12-action.jpeg',
  '/insta-photos/15-action.jpeg',
  '/insta-photos/17-action.jpeg',
]

function shopInsta(props) {
  const [photos, setPhotos] = useState(instaPhotos)

  return (
    <div className='shop-insta'>
      <h1 className='insta-header'>shop insta</h1>
      <div className='insta-grid'>
        {photos.map((p) => (
          <img className='insta-photo' src='.'/>
        ))}
      </div>
      <Link href='/'>
        <a>BACK HOME</a>
      </Link>
    </div>
  );
}

export default shopInsta;
